ge.",lvl=60,mapID=162,maps={163,164,165,166,167},rwp=30002,savedInstanceID=533,sourceQuests={9121},u=1611,["zone-text-areaID"]=3456,g={h(22631,{c={5,8,9,11},isRaid=1,lore="Atiesh is one of the most coveted legendaries in the game. In addition to being Best-In-Slot for some specs, it also provides a Unique Party-Wide Bufff:\n\nWarlock: 33 Spell Power and Healing\nMage: 2% Crit\nPriest: 62 Healing\nDruid: 11 Mp5",maps={75},rwp=30002,type="i",u=1611,g={ach(425,{c={5,8,9,11},OnUpdate=handlers.ANY_ITEM_PROVIDER,providers={{"i",22631},{"i",22589},{"i",22630},{"i",22632}},rwp=30002,u=1611}),q(9251,{c={5,8,9,11},maps={320},qgs={15192},rwp=30002,sourceQuests={9250},u=1611,g={qo(1,{providers={{"i",22733}},rwp=30002,u=1611}),qo(2,{providers={{"i",22734}},rwp=30002,u=1611})}}),q(9257,{c={5},cost={{"i",22737,1}},maps={317},qgs={15192},rwp=30002,sourceQuests={9251},u=1611,g={s(165013,22631,{b=1,f=28,q=5,rwp=30002,u=1611}),crit(749,{achID=425,id=1,rwp=30002})}}),q(9270,{c={8},cost={{"i",22737,1}},maps={317},qgs={15192},rwp=30002,sourceQuests={9251},u=1611,g={s(165010,22589,{b=1,f=28,q=5,rwp=30002,u=1611}),crit(748,{achID=425,id=1,rwp=30002})}}),q(9271,{c={9},cost={{"i",22737,1}},maps={317},qgs={15192},rwp=30002,sourceQuests={9251},u=1611,g={s(165012,22630,{b=1,f=28,q=5,rwp=30002,u=1611}),crit(750,{achID=425,id=1,rwp=30002})}}),q(9269,{c={11},cost={{"i",22737,1}},maps={317},qgs={15192},rwp=30002,sourceQuests={9251},u=1611,g={s(165014,22632,{b=1,f=28,q=5,rwp=30002,u=1611}),crit(747,{achID=425,id=1,rwp=30002})}}),q(9250,{c={5,8,9,11},cost={{"i",22726,40}},description="Collect 40 of the Splinters to craft the Frame of Atiesh. This starts the quest chain for Atiesh. You will need to coordinate with your guild to get priority on Splinters.",providers={{"i",22727}},rwp=30002,u=1611})}}),n(-1000004,{rwp=30002,u=1611,g={s(169660,191481,{awp=11403,b=1,description="This was obtained from killing Kel'Thuzad in Naxxramas40 on 'Season of Mastery' realms, while entire raid having the buff Undyin