-1000038,{description="After dealing with Aku'mai, you can head back to Lady Sarevess' cave and delve deeper, now that the waterfall is gone. At the very end of the cave, you will be able to loot the recipes from a table.",rwp=20001,u=1605,g={r(430409,{b=1,itemID=211849,learnedAt=100,providers={{"o",415614}},q=3,requireSkill=333,rwp=20001,u=1605}),r(430397,{b=1,itemID=211846,learnedAt=100,providers={{"o",415614}},q=3,requireSkill=164,rwp=20001,u=1605})}}),n(-1000010,{crs={204921,207356,209678,213334},description="The Twilight armor sets can drop from any of the last 4 bosses.",rwp=20001,u=1605,g={s(194155,211505,{b=1,f=6,q=3,rwp=20001,u=1605}),s(194154,211504,{b=1,f=6,q=3,rwp=20001,u=1605}),s(194156,211506,{b=1,f=6,q=3,rwp=20001,u=1605}),s(194157,211507,{b=1,f=5,q=3,rwp=20001,u=1605}),s(194159,211509,{b=1,f=5,q=3,rwp=20001,u=1605}),s(194158,211508,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190932,209683,{b=1,f=4,q=3,rwp=20001,u=1605}),s(190923,209671,{b=1,f=4,q=3,rwp=20001,u=1605}),s(190921,209669,{b=1,f=4,q=3,rwp=20001,u=1605}),s(194160,211510,{b=1,f=5,q=3,rwp=20001,u=1605}),s(194162,211512,{b=1,f=5,q=3,rwp=20001,u=1605}),s(194161,211511,{b=1,f=5,q=3,rwp=20001,u=1605})}}),n(202699,{description="Baron Aquanis sits stationary atop three broken platforms, and raid members must dodge his mechanics to avoid being thrown into the water and possibly aggroing extra enemies - Bubble Beam knocks enemies in front of him, and Depth Charge knocks back anyone close to the target! In addition to this, players must jump through platforms to avoid Torrential Downpour damage.",rwp=20001,u=1605,g={i(211454,{b=1,q=1,r=1,rwp=20001,u=1605}),s(185841,204807,{b=1,f=26,q=3,rwp=20001,u=1605}),s(190867,209590,{b=1,f=1,q=3,rwp=20001,u=1605}),i(209825,{b=1,f=51,q=3,rwp=20001,u=1605}),i(209422,{b=1,f=51,q=3,rwp=20001,u=1605}),s(190753,209423,{b=1,f=3,q=3,rwp=20001,u=1605}),s(190927,209676,{b=1,f=6,q=3,rwp=20001,u=1605}),s(191031,209828,{b=1,f=4,q=3,rwp=20001,u=1605}),s(185840,204804,{b=1,f=6,q=3,rwp=200