01,u=1605}),i(209565,{b=1,f=52,q=3,rwp=20001,u=1605}),i(209823,{b=1,c={3},f=52,q=3,rwp=20001,u=1605})}}),n(204921,{description="Gelihast has a quite dangerous curse with Curse of Blackfathom, so you must have ways to decurse it off. The raid must avoid getting hit by Shadow Crash while the tanks taunt swap to prevent reaching high stacks of Shadow Strike. Healers can also dispel the random Fear he throws at people.\n\nThe big mechanic happens once the boss reaches 10% - March of the Murlocs will begin, spawning dozens of murlocs that players must dodge while the boss heals himself and throws more Shadow Crashes. Once fully healed, the fight starts again, with Gelihast summoning low-health Blackfathom Tendril that must be killed. Gelihast will heal himself to full twice with March of the Murlocs before finally dying.",rwp=20001,u=1605,g={s(190848,209567,{b=1,f=22,q=3,rwp=20001,u=1605}),s(190852,209571,{b=1,f=27,q=3,rwp=20001,u=1605}),s(190841,209559,{b=1,f=28,q=3,rwp=20001,u=1605}),s(190854,209573,{b=1,f=28,q=3,rwp=20001,u=1605}),s(190851,209570,{b=1,f=1,q=3,rwp=20001,u=1605}),i(209820,{b=1,f=51,q=3,rwp=20001,u=1605}),s(190849,209568,{b=1,f=6,q=3,rwp=20001,u=1605}),s(190853,209572,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190850,209569,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190922,209670,{b=1,f=4,q=3,rwp=20001,u=1605}),i(209821,{b=1,f=52,q=3,rwp=20001,u=1605}),i(209681,{b=1,f=53,q=3,rwp=20001,u=1605}),i(211491,{b=1,f=113,q=4,rwp=20001,u=1605})}}),n(207356,{description="Lorgus Jett can be found behind a gauntlet of Naga and Murlocs that must be dealt with before engaging the boss itself. Lorgus Jett himself has 3 totems he will use - One totem is spawned every 10 seconds in a set order. You can simply ignore two out of the three totems and DPS Lorgus Jett:\n\n    Corrupted Windfury Totem - Ignore and tank through his enhanced attacks;\n    Corrupted Lightning Shield Totem - Kill this totem immediately once it spawns;\n    Corrupted Molten Fury Totem - Ignore this totem and dodge the molten boulders it spawns.",rwp=20001,u=1605,g={s(190857,209579,{b=1,f=34,q=3,rwp=20001,u=1605}),s(190855,209577,{b=1,f=24,q=3,rwp=20001,u=1605}),s(190842,209560,{b=1,f=23,q=3,rwp=20001,u=1605}),s(191028,209818,{b=1,f=20,q=3,rwp=20001,u=1605}),s(190931,209682,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190856,209578,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190859,209581,{b=1,f=6,q=3,rwp=20001,u=1605}),i(209575,{b=1,q=3,rwp=20001,u=1605}),i(209574,{b=1,q=3,rwp=20001,u=1605}),i(209576,{b=1,q=3,rwp=20001,u=1605})}}),n(209678,{description="Kelris is a two-phase fight with Phase 1 starting on pull and Phase 2 starting at 35%, so DPS must hold their big cooldowns until Kelris enters Phase 2. Through the fight, players must dodge Shadow Crashes and interrupt Shadowy Chains (priority) and Mind Blast.\n\nThe main difficult in the fight is the Dream Realm mechanic - Every so often, the two closest players to Kelris will be put to Sleep, being sent to a Dream Realm in which they need to kill neutral Phantasmal Priestesses for a chance to spawn a portal to be sent back to reality. After 30 seconds in the Dream Phase, the Priestesses will become aggressive and attack the two players on the Dream Realm. If possible, avoid using casters to go to the Dream Realm, as the Priestesses have high magical resistance.\n\nOnce Kelris reaches 35%, Phase 2 will start - Kelris will no longer send players to the Dream Realm, but will deal increased damage, in addition to his previous interruptible spells now being immune to interrupts. Save your resources and spread around the room to burn the boss down!",rwp=20001,u=1605,g={s(190843,209561,{b=1,f=28,q=4,rwp=20001,u=1605}),s(190941,209694,{b=1,f=20,q=3,rwp=20001,u=1605}),s(190925,209674,{b=1,f=27,q=3,rwp=20001,u=1605}),s(194137,211458,{b=1,f=1,q=3,rwp=20001,u=1605}),i(209673,{b=1,f=51,q=3,rwp=20001,u=1605}),i(209686,{b=1,f=51,q=3,rwp=20001,u=1605}),i(209817,{b=1,f=51,q=3,rwp=20001,u=1605}),s(190924,209672,{b=1,f=4,q=3,rwp=20001,u=1605}),s(194134,211455,{b=1,f=5,q=3,rwp=20001,u=1605}),s(194136,211457,{b=1,f=6,q=3,rwp=20001,u=1605}),s(190920,209667,{b=1,f=4,q=3,rwp=20001,u=1605}),i(209668,{b=1,f=52,q=3,rwp=20001,u=1605}),i(209816,{b=1,c={9},f=53,q=3,rwp=20001,u=1605}),i(211492,{b=1,c={9},f=113,q=4,rwp=20001,u=1605})}}),n(213334,{description="Once engaged, all raid members should stay close to Aku'mai at all times, to easily dodge the Corrosive Blast cones. Getting hit by this gives a stack of Corrosion. Tanks will naturally be affected with Corrosion over time, and once they reach 3-4 stacks of Corrosion, they must drag themselves and the boss to one of the four Cleansing Pool scattered across the room - Cleansing themselves and generating adds that must be killed.\n\nOnce Aku'mai hits 50%, he will enter Phase 2 by casting Dark Protection becoming big and voidlike. His abilities remain mostly the same, but now deal Shadow damage instead of Nature. The main difference is that Corrosion becomes Shadow Seep, and tanks must taunt swap to avoid getting high stacks of the debuff. It is possible to cleanse these the same way as you did Corrosion in Phase 1, but it is largely unnecessary if your DPS is good.",rwp=20001,u=1605,g={i(209693,{b=1,q=3,rwp=20001,u=1605}),i(211452,{b=1,q=3,rwp=20001,u=1605}),s(194135,211456,{b=1,f=20,q=3,rwp=20001,u=1605}),s(190844,209562,{b=1,f=26,q=4,rwp=20001,u=1605}),s(190939,209691,{b=1,f=20,q=3,rwp=20001,u=1605}),s(190816,209534,{b=1,f=33,q=4,rwp=20001,u=1605}),s(190936,209688,{b=1,f=31,q=3,rwp=20001,u=1605}),s(190858,209580,{b=1,f=34,q=3,rwp=20001,u=1605}),s(190938,209690,{b=1,f=6,q=3,rwp=20001,u=1605}),s(190940,209692,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190935,209687,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190934,209685,{b=1,f=5,q=3,rwp=20001,u=1605}),s(190933,209684,{b=1,f=4,q=3,rwp=20001,u=1605}),s(190937,209689,{b=1,f=6,q=3,rwp=20001,u=1605})}})}})}}),inst(228,{coords={{39.06,18.12,35}},description="The best route for a full clear is to enter Shadowforge City first time through the Dark Iron Highway. The Detention Block can be cleared whenever.",lore="Once the capital city of the Dark Iron dwarves, this volcanic labyrinth now serves as the seat of power for Ragnaros the Firelord. Ragnaros has uncovered the secret to creating life from stone and plans to build an army of unstoppable golems to aid him in conquering the whole of Blackrock Mountain. Obsessed with defeating Nefarian and his draconic minions, Ragnaros will go to any extreme to achieve final victory.",lvl=42,mapID=242,maps={243},savedInstanceID=230,u=1607,["zone-text-areaID"]=1584,g={n(-1000020,{faction(59,{maps={1427},OnTooltip=_.OnTooltipDB.ThoriumBrotherhood})}),n(-1000031,{q(84338,{awp=11503,cost={{"i",17203,1}},description="With a Sulfuron Ingot in your bags, speak with Lokhtos and click on the new chat option to obtain a Thorium Brotherhood Contract.",lvl=60,providers={{"i",227730}},qgs={12944},requireSkill=164,u=1608,g={r(460460,{itemID=227727,learnedAt=325,q=4,requireSkill=164,u=1608})}}),q(7604,{cost={{"i",17203,1}},description="With a Sulfuron Ingot in your bags, speak with Lokhtos and click on the new chat option to obtain a Thorium Brotherhood Contract.",lvl=60,providers={{"i",18628}},qgs={12944},requireSkill=164,rwp=11503,u=2,g={r(21161,{itemID=18592,learnedAt=300,q=4,requireSkill=164,rwp=11503,u=2})}}),q(4264,{description="After completing the Abandoned Hope quest, kill trash until this item drops for you. If your group has not yet killed the Dark Keeper, they have a fairly high chance to drop this item as well.",lvl=50,providers={{"i",11446}},r=2,rwp=30002,sourceQuests={4242}}),q(4282,{lvl=50,qgs={9023},r=2,rwp=30002,sourceQuests={4264},g={qo(1,{providers={{"i",11464}},rwp=30002}),qo(2,{providers={{"i",11465}},rwp=30002})}}),q(4022,{altQuests={4023},coords={{95.09,31.56,1428}},cost={{"i",10575,1}},description="If you completed the quest 'Trinkets...' in Searing Gorge, you can complete this quest immediately without having to fight the elite dragon by bringing the Black Dragonflight Mo