 east of the Ring in Blackrock Depths is a bridge that leads north over lava.\n\nAs you get onto the bridge, look down and to the left; you'll see a friendly Dark Iron Dwarf below you on the base of a pillar. Clear the rest of the mobs ahead of you (Blazing Fireguards and a group of Shadowforge dwarves).\n\nMove to the left side of the bridge near a small brazier. Get onto the railing, hug the rock wall, and jump ahead onto the platform near the wall.\n\nMove to the end of the platform, hugging the wall, and move hard into the rock corner.\n\nTurn with your left shoulder to the wall and run carefully against the wall, until you just fall down into the exposed corner. Drop down onto the rock outcrop below. \n\nTurn left into a small room, where you'll encounter the Rugged Traveler.",lvl=48,qgs={222530},rwp=20001,u=1607,g={s(219208,221316,{b=1,f=10,q=1,rwp=20001,u=1607}),toy(221315,{b=1,q=3,rwp=20001,u=1607})}}),q(6646,{cost={{"i",11382,1}},lvl=60,maxReputation={59,42000},qgs={12944},repeatable=1}),q(6645,{cost={{"i",17012,2}},lvl=60,maxReputation={59,42000},qgs={12944},repeatable=1}),q(6642,{cost={{"i",11370,10}},lvl=60,maxReputation={59,42000},qgs={12944},repeatable=1}),q(6643,{cost={{"i",17010,1}},lvl=60,maxReputation={59,42000},qgs={12944},repeatable=1}),q(6644,{cost={{"i",17011,1}},lvl=60,maxReputation={59,42000},qgs={12944},repeatable=1}),q(4122,{coords={{5.9,47.6,1418}},lvl=52,providers={{"i",11286}},qgs={9080},r=1,rwp=40003,sourceQuests={4082}}),q(4126,{coords={{46.8,52.4,1426}},lvl=50,qgs={1267},r=2,rwp=40003,sourceQuests={4128},g={qo(1,{providers={{"i",11312}},rwp=40003}),s(160421,12000,{b=1,f=22,q=2,rwp=40003}),s(160420,11964,{b=1,f=23,q=2,rwp=40003}),i(12003,{f=55,q=1,rwp=40003})}}),q(4263,{coords={{85.4,70.1,1428}},lvl=48,qgs={9561},r=2,rwp=40003,sourceQuests={4262},g={qo(1,{providers={{"n",9017}},rwp=40003}),s(160443,12112,{b=1,f=6,q=2,rwp=40003}),s(160445,12114,{b=1,f=5,q=2,rwp=40003}),s(160446,12115,{b=1,f=7,q=2,rwp=40003}),s(160444,12113,{b=1,f=3,q=2,