06}),i(217009,{b=1,q=3,rwp=20001,u=1606}),i(217007,{b=1,q=3,rwp=20001,u=1606}),s(196769,215377,{b=1,f=4,q=3,rwp=20001,u=1606}),s(196771,215379,{b=1,f=4,q=3,rwp=20001,u=1606}),s(196770,215378,{b=1,f=4,q=3,rwp=20001,u=1606})}}),n(216666,{description="Located outside the instance near the teleporter.",rwp=20001,u=1606,g={i(213736,{awp=11501,b=1,q=2,rwp=20001,u=1606}),i(9277,{awp=11501,q=1,rwp=20001,u=1606}),s(159364,9444,{f=8,q=1,rwp=40003,u=1606})}}),n(217280,{description="The Grubbis fight starts with a short gauntlet style fight, a mix of Troggs will spawn in small waves followed by Poison Clouds, you should kite the the Troggs into the Poison Clouds. This causes the Poison Clouds to explode and kill the Troggs and then despawn.\n\nAfter a few waves, Grubbis spawns alongside his basilisk pet - Chomper, because of his pet this fight easier to manage with two tanks, but not required with disciplined damage dealers who focus Grubbis himself - this makes threat more manageable. Additionally, everyone with an interrupt must be paying close attention to Chomper's casts, to kick the Petrify cast - otherwise the only tank will lose threat of both bosses.\n\nOnce he spawns, the waves of Troggs and Poison Clouds continue to spawn, these can be managed through the same means as during the gauntlet by kiting the mobs into the clouds. It is possible to ignore the clouds for uptime and cleave or ignore the adds while focusing the boss but it is not recommended for the average raid.",rwp=20001,u=1606,g={s(195328,213542,{b=1,f=1,q=3,rwp=20001,u=1606}),s(195289,213351,{b=1,f=8,q=3,rwp=20001,u=1606}),s(195273,213327,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195240,213294,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195272,213326,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195234,213288,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195270,213324,{b=1,f=6,q=3,rwp=20001,u=1606}),s(195250,213304,{b=1,f=6,q=3,rwp=20001,u=1606}),s(195269,213323,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195268,213322,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195267,213321,{b=1,f=4,q=3,rwp=20001,u=1606}),i(215437,{b=1,q=3,rwp=20001,u=1606}),i(216490,{b=1,q=3,rwp=20001,u=1606}),i(215435,{b=1,q=3,rwp=20001,u=1606}),i(215436,{b=1,q=3,rwp=20001,u=1606})}}),n(220007,{description="He will drop pools of toxic slime that both damages and slows those that stand on it. Making sure to move the boss out of these will make it a lot easier for healers.\n\nThe Viscous Fallout boss will also sometimes spawn in 3x Irradiated Goo, these will run towards the fallen Desiccated Fallout in the ground, make sure to kill them before they make it to the corpses or they will respawn the Desiccated Fallout which cause a lot more raid-wide damage if not interrupted. This can be made easier by initially moving the boss to further from the Desiccated Fallout corpses to give longer leeway for killing the Irradiated Goo.",rwp=20001,u=1606,g={s(195237,213291,{b=1,f=20,q=4,rwp=20001,u=1606}),s(195290,213352,{b=1,f=23,q=3,rwp=20001,u=1606}),s(195291,213353,{b=1,f=28,q=4,rwp=20001,u=1606}),s(195235,213289,{b=1,f=28,q=3,rwp=20001,u=1606}),s(195293,213355,{b=1,f=33,q=3,rwp=20001,u=1606}),s(195253,213307,{b=1,f=3,q=3,rwp=20001,u=1606}),s(195310,213413,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195248,213302,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195245,213299,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195247,213301,{b=1,f=4,q=3,rwp=20001,u=1606}),s(195232,213285,{b=1,f=4,q=3,rwp=20001,u=1606}),s(195236,213290,{b=1,f=4,q=3,rwp=20001,u=1606})}}),n(220072,{description="The main mechanic of this fight comes from Static Arc, this ability does a chain lighting cast on a player and it bounces twice, hitting a total of three players - these get debuffed and cannot be hit by it again twice in a row or the 500% damage increase will kill them.\n\nThe way to deal with it is to have two pre-assigned groups be moving in and out of close proximity to the boss in order to soak every other Static Arc. Doing this will make the mechanic safe. Ideally have the caster damage dealers do this so that the melee can keep up high uptime on the boss. Healers can potentially be assigned for moving in and out as well, but ideally it's important that they can heal freely since the fight has somewhat respectable damage throughout.\n\nLastly, Magnetic Pulse is an ability that must be respected by everyone, if targeted the player must move out to a empty space or pre-assigned spot in order to avoid damaging other players as well. Just be aware that if targeted, the player should not by any means ever be further away from the boss than the groups soaking Static Arc, otherwise you'll get targeted by it instead and potentially killing the players with the debuff that are currently standing near the boss.",rwp=20001,u=1606,g={s(195330,213560,{b=1,f=23,q=3,rwp=20001,u=1606}),s(195233,213286,{b=1,f=25,q=4,rwp=20001,u=1606}),s(195292,213354,{b=1,f=28,q=3,rwp=20001,u=1606}),s(195239,213293,{b=1,f=31,q=3,rwp=20001,u=1606}),s(195329,213559,{b=1,f=27,q=3,rwp=20001,u=1606}),s(195255,213309,{b=1,f=3,q=3,rwp=20001,u=1606}),s(195315,213418,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195229,213279,{b=1,f=6,q=3,rwp=20001,u=1606}),s(195265,213319,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195246,213300,{b=1,f=4,q=3,rwp=20001,u=1606}),s(195311,213414,{b=1,f=4,q=3,rwp=20001,u=1606}),s(195244,213298,{b=1,f=4,q=3,rwp=20001,u=1606}),i(213287,{b=1,f=52,q=3,rwp=20001,u=1606}),i(216494,{b=1,q=3,rwp=20001,u=1606})}}),n(215728,{description="This fight only requires one tank and should just be tanked normally, the tank should be careful to not get knocked back in order to help with melee dps uptime.\n\nThe boss will initially throw out two gears onto the floor using Gear Toss, which you must dodge as they run linearly through the boss area, they're pretty slow so just position with them in mind since they can knock the players off the platforms and kill them.\n\nOccasionally, the boss will shoot out a frontal Gnomeregan Smash which targets a player and shoots a large projectile that will knock back and kill mainly via fall damage, this can easily be dodged by looking at the boss's feet to see where he's facing since the upper half of the body can be facing elsewhere.\n\nTowards the end of the fight (30%) the boss will also be able to cast The Claw! which will target a random player and dash to grab them and do significant damage - this is telegraphed quite well so healers should pay attention to it and keep that player alive through the initial damage and follow up.",rwp=20001,u=1606,g={s(195326,213442,{b=1,f=34,q=3,rwp=20001,u=1606}),s(195241,213295,{b=1,f=21,q=3,rwp=20001,u=1606}),s(193786,210741,{b=1,c={2,7,11},f=24,q=3,rwp=20001,u=1606}),s(195238,213292,{b=1,f=26,q=3,rwp=20001,u=1606}),s(195305,213408,{b=1,f=29,q=3,rwp=20001,u=1606}),s(195316,213419,{b=1,f=1,q=3,rwp=20001,u=1606}),s(195309,213412,{b=1,f=8,q=4,rwp=20001,u=1606}),s(195251,213305,{b=1,f=7,q=3,rwp=20001,u=1606}),s(195263,213317,{b=1,f=6,q=3,rwp=20001,u=1606}),s(195228,213278,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195286,213340,{b=1,f=5,q=3,rwp=20001,u=1606}),s(195312,213415,{b=1,f=4,q=3,rwp=20001,u=1606}),toy(215449,{b=1,q=2,rwp=20001,u=1606})}}),n(218242,{description="The chicken, squirrel and whelp must be tanked, meaning it requires at least two tanks.\n\nThe sheep instead of being tanked, targets a player and slowly moves towards them. It must be kited, ideally somewhat near the other three but not close enough where it'll Binary Bleat silence the melee and tanks.\n\nRanged should stand near the middle so that the tank and melee can kite the bosses around the perimeter of the boss area.\n\nThe dps should try to damage the bosses somewhat evenly - but pay attention to which boss the whelp applies Overheat onto, since this causes that target to get damaged 25% more while the buff is active, making it more effective to focus while it's up.\n\nEvery boss should die at the same time, otherwise they cast Self Repair which only gets canceled by all of them being at 1hp - this ability will heal them for 31% of their total health.",rwp=20001,u=1606,g={s(195307,213410,{awp=11501,b=1,f=20,q=4,rwp=20001,u=1606}),s(195243,213297,{awp=11501,b=1,f=23,q=3,rwp=20001,u=1606}),s(195242,213296,{awp=11501,b=1,f=22,q=3,rwp=20001,u=1606}),s(195308,213411,{awp=11501,b=1,f=27,q=3,rwp=20001,u=1606}),s(195252,213306,{awp=11501,b=1,f=3,q=3,rwp=20001,u=1606}),s(195254,213308,{awp=11501,b=1,f=3,q=3,rwp=20001,u=1606}),s(195230,213280,{awp=11501,b=1,f=6,q=3,rwp=20001,u=1606}),s(195249,213303,{awp=11501,b=1,f=6,q=3,rwp=20001,u=1606}),s(195266,213320,{awp=11501,b=1,f=6,q=3,rwp=20001,u=1606}),s(195271,213325,{awp=11501,b=1,f=6,q=3,rwp=20001,u=1606}),s(196772,215380,{awp=11501,b=1,f=6,q=4,rwp=20001,u=1606}),s(195264,213318,{awp=11501,b=1,f=5,q=3,rwp=20001,u=1606}),s(195314,213417,{awp=11501,b=1,f=7,q=3,rwp=20001,u=1606}),r(3966,{awp=11501,itemID=4415,learnedAt=185,q=3,requireSkill=202,rwp=20001,u=1606}),r(3959,{awp=11501,itemID=4413,learnedAt=160,q=2,requireSkill=202,rwp=20001,u=1606}),r(8339,{awp=11501,itemID=6716,learnedAt=100,q=2,requireSkill=202,rwp=20001,u=1606}),r(3944,{awp=11501,itemID=4411,learnedAt=125,q=2,requireSkill=202,rwp=20001,u=1606}),r(8243,{awp=11501,itemID=6672,learnedAt=185,q=2,requireSkill=202,rwp=20001,u=1606}),r(3971,{awp=11501,itemID=7742,learnedAt=200,q=1,requireSkill=202,rwp=20001,u=1606}),r(9269,{awp=11501,itemID=7560,learnedAt=125,q=1,requireSkill=202,rwp=20001,u=1606}),r(3968,{awp=11501,itemID=4416,learnedAt=195,q=2,requireSkill=202,rwp=20001,u=1606}),r(8895,{itemID=7192,learnedAt=225,q=2,requireSkill=20222,rwp=30002,u=2}),r(3972,{awp=11501,itemID=4417,learnedAt=200,q=2,requireSkill=202,rwp=20001,u=1606}),r(3928,{awp=11501,itemID=4408,learnedAt=75,q=2,requireSkill=202,rwp=20001,u=1606}),r(3954,{awp=11501,itemID=4412,learnedAt=145,q=2,requireSkill=202,rwp=20001,u=1606}),r(3960,{awp=11501,itemID=4414,learnedAt=165,q=2,requireSkill=202,rwp=20001,u=1606}),r(3933,{awp=11501,itemID=4409,learnedAt=100,q=2,requireSkill=202,rwp=20001,u=1606})}}),n(218537,{description="This fight requires two tanks, as each phase has a different forced tank swap mechanic.\n\nThroughout the fight, the six pillars around the boss arena will ocasionally activate and spawn in bombs if different types depending on the current phase. These pillars must be turned off by clicking the red button to on their right side.\n\nDuring the first phase, the fire boss will be stacking Sprocketfire on the tank, via either Sprocketfire Punch, Furnace Surge, and Incendiary Bombs; and on the raid through the latter two. Furnace Surge can be avoided entirely even by the tank by running directly away from the boss while it does its frontal. Between 5 and 7 stacks, the off-tank should taunt and pick up the boss until the main tank's Sprocketfire runs out.\n\nDuring the second phase, the frost boss will be stacking Freezing on the raid, via Coolant Discharge, and Frost Bomb; and on the tank, via Supercooled Smash. This debuff can be dispelled, meaning one tank can handle the boss the entire phase - without worrying about getting Frozen Solid. Make sure to keep the tank and the raid below 9 stacks, because during the 10th, it will freeze the target, and when Coolant Discharge is cast, it'll causes a raid-wipe.\n\nDuring the third phase, the nature boss will be stacking Radiation Sickness on the raid via Radioactive Bomb; and on the tank through Hazardous Hammer. These stacks should be either dispelled, or at least kept low. Otherwise, when the Toxic Ventilation gets casted, it'll have massive AoE damage. Toxic Ventilation can be interrupted, but the lack of a cast bar can make it more challenging than normal - so those with kicks should pay close attention.\n\nDuring the fourth phase, STX-99/XD will spawn and have all of the abilities mentioned above, although it sounds chaotic, it makes each individual mechanic somewhat easier to deal with, since the none of the three stacks will be major concern as long as you continue dealing with the bombs, and remember the previous basic mechanics.",rwp=20001,u=1606,g={mnt(17458,{awp=11501,b=1,itemID=13325,q=3,rwp=20001,u=1606}),i(217350,{awp=11501,b=1,q=4,rwp=20001,u=1606}),i(217351,{awp=11501,b=1,q=4,rwp=20001,u=1606}),s(195306,213409,{awp=11501,b=1,f=34,q=4,rwp=20001,u=1606}),s(195294,213356,{awp=11501,b=1,f=31,q=4,rwp=20001,u=1606}),s(195313,213416,{awp=11501,b=1,f=22,q=4,rwp=20001,u=1606}),s(195231,213281,{awp=11501,b=1,f=4,q=3,rwp=20001,u=1606}),s(198590,216608,{awp=11501,b=1,f=4,q=4,rwp=20001,u=1606}),i(213283,{awp=11501,b=1,f=52,q=4,rwp=20001,u=1606}),i(213284,{awp=11501,b=1,f=52,q=4,rwp=20001,u=1606}),i(213282,{awp=11501,b=1,f=52,q=4,rwp=20001,u=1606}),i(215461,{awp=11501,b=1,f=53,q=3,rwp=20001,u=1606}),i(213349,{awp=11501,b=1,f=53,q=3,rwp=20001,u=1606}),i(213348,{awp=11501,b=1,f=53,q=3,rwp=20001,u=1606}),i(213347,{awp=11501,b=1,f=53,q=3,rwp=20001,u=1606}),i(213350,{awp=11501,b=1,f=53,q=3,rwp=20001,u=1606}),r(3966,{awp=11501,itemID=4415,learnedAt=185,q=3,requireSkill=202,rwp=20001,u=1606}),r(3959,{awp=11501,itemID=4413,learnedAt=160,q=2,requireSkill=202,rwp=20001,u=1606}),r(8339,{awp=11501,itemID=6716,learnedAt=100,q=2,requireSkill=202,rwp=20001,u=1606}),r(3944,{awp=11501,itemID=4411,learnedAt=125,q=2,requireSkill=202,rwp=20001,u=1606}),r(8243,{awp=11501,itemID=6672,learnedAt=185,q=2,requireSkill=202,rwp=20001,u=1606}),r(3971,{awp=11501,itemID=7742,learnedAt=200,q=1,requireSkill=202,rwp=20001,u=1606}),r(9269,{awp=11501,itemID=7560,learnedAt=125,q=1,requireSkill=202,rwp=20001,u=1606}),r(9273,{awp=11501,itemID=7561,learnedAt=165,q=1,requireSkill=202,rwp=20001,u=1606}),r(3968,{awp=11501,itemID=4416,learnedAt=195,q=2,requireSkill=202,rwp=20001,u=1606}),r(8895,{itemID=7192,learnedAt=225,q=2,requireSkill=20222,rwp=30002,u=2}),r(3972,{awp=11501,itemID=4417,learnedAt=200,q=2,requireSkill=202,rwp=20001,u=1606}),r(3928,{awp=11501,itemID=4408,learnedAt=75,q=2,requireSkill=202,rwp=20001,u=1606}),r(3954,{awp=11501,itemID=4412,learnedAt=145,q=2,requireSkill=202,rwp=20001,u=1606}),r(3960,{awp=11501,itemID=4414,learnedAt=165,q=2,re