19,{rwp=50004})}}),inst(233,{coords={{50,92,1413}},lore="Crafted from the same mighty vines as Razorfen Kraul, Razorfen Downs is the traditional capital city of the quillboar race. The sprawling, thorn-ridden labyrinth houses a veritable army of loyal quillboar as well as their high priests - the Death's Head tribe. Recently, however, a looming shadow has fallen over the crude den. Agents of the undead Scourge - led by the lich, Amnennar the Coldbringer - have taken control over the quillboar race and turned the maze of thorns into a bastion of undead might. Now the quillboar fight a desperate battle to reclaim their beloved city before Amnennar spreads his control across the Barrens.",lvl=35,mapID=300,savedInstanceID=129,u=1606,["zone-text-areaID"]=722,g={n(-1000031,{q(6626,{coords={{49,94,1413}},qgs={12866},rwp=40003,g={qo(1,{providers={{"n",7873}},rwp=40003}),qo(2,{providers={{"n",7874}},rwp=40003}),qo(3,{providers={{"n",7872}},rwp=40003})}}),q(6521,{coords={{56.3,92.2,1458}},maps={1413},qgs={2425},r=1,rwp=40003,sourceQuests={6522},g={qo(1,{coords={{48.6,95.6,1413}},crs={12865},providers={{"i",17009}},rwp=40003}),s(163248,17039,{b=1,f=23,q=2,rwp=40003}),s(163251,17042,{b=1,f=31,q=2,rwp=40003}),s(163252,17043,{b=1,f=4,q=2,rwp=40003})}}),q(3341,{coords={{74,32.8,1458}},lvl=37,qgs={2308},r=1,rwp=40003,g={qo(1,{providers={{"i",10420}},rwp=40003}),s(160191,10823,{b=1,f=25,q=3,rwp=40003}),i(10824,{b=1,f=51,q=3,rwp=40003})}}),q(3636,{coords={{39.6,27.4,1453}},lvl=39,qgs={1284},r=2,rwp=40003,g={qo(1,{providers={{"n",7358}},rwp=40003}),s(160191,10823,{b=1,f=25,q=3,rwp=40003}),i(10824,{b=1,f=51,q=3,rwp=40003})}}),q(3525,{providers={{"o",152097}},qgs={8516},rwp=40003,sourceQuests={3523},g={i(10710,{b=1,f=52,q=3,rwp=40003})}}),q(3523,{providers={{"i",10682}},qgs={8516},rwp=40003})}),n(-1000044,{i(3172,{crs={7333,7334},q=1}),s(160079,10573,{f=26,q=3}),s(160084,10582,{f=5,q=3}),s(160080,10574,{f=4,q=3}),s(160083,10581,{f=4,q=3}),s(160077,10571,{f=23,q=3}),s(160078,10572,{c={8}