ine.\nHead up the stairs behind the boss, and take a right, gefell should be in a room up the stairs around the corner.",q=1,rwp=20001,u=1605}),i(210213,{b=1,c={4},crs={211765},description="Just after the Kitchen in baron silverlaine's room.",q=1,rwp=20001,u=1605})}}),n(-1000031,{q(1014,{coords={{44.2,39.8,1421}},lvl=18,qgs={1938},r=1,rwp=40003,g={qo(1,{providers={{"i",5442}},rwp=40003}),i(6414,{b=1,f=52,q=3,rwp=40003})}}),q(1098,{coords={{43.4,40.8,1421}},lvl=18,qgs={1952},r=1,rwp=40003,g={s(157245,3324,{b=1,f=4,q=2,rwp=40003})}}),q(78261,{c={4},coords={{47.1,71.1,1421}},lvl=20,providers={{"o",410369},{"i",210186}},rwp=20001,u=1605,g={qo(1,{cost={{"i",210213,1},{"i",210212,1}},description="Once you've gotten both of the half keys from pick pocketing the npcs, combine them and bring the twin key to the ornamented chest in the stables.",providers={{"i",210183},{"o",410528},{"i",210209}},rwp=20001,u=1605})}}),q(78307,{c={4},coords={{47.1,71.1,1421}},description="15 minutes or so after you turn in the first part of the Horn of Xelthos, you'll receive another mail from C and be able to loot the rune from the dead drop outside of SFK.",lvl=20,providers={{"o",410369}},rwp=20001,sourceQuests={78261},u=1605,g={i(203994,{b=1,c={4},f=55,q=2,rwp=20001,u=1605,g={r(400080,{rwp=20001,u=1605})}})}}),q(1013,{coords={{54,54.6,1458}},lvl=16,qgs={2934},r=1,rwp=40003,g={qo(1,{description="Can be found on a bookshelf in the circular room with Fenrus.",providers={{"i",6283},{"o",36738}},rwp=40003}),s(157799,4534,{b=1,f=6,q=2,rwp=40003}),s(158422,6335,{b=1,f=5,q=2,rwp=40003})}}),q(1740,{c={9},coords={{49.2,57.2,1413}},lvl=20,maps={221},qgs={6247},rwp=40003,g={qo(1,{crs={4809},providers={{"i",6914}},rwp=40003}),qo(2,{crs={3855},providers={{"i",6915}},rwp=40003}),s(158710,6898,{b=1,c={9},f=1,q=2,rwp=40003}),s(162032,15109,{b=1,c={9},f=28,q=2,rwp=40003})}})}),n(-1000044,{s(156526,1935,{f=20,lvl=19,q=3}),s(157161,3194,{f=24,lvl=16,q=3}),s(156694,2205,{crs={2529,3857,3859,3863,3873,3877},f=26,