here Prince Arthas turned against his mentor, Uther Lightbringer, and slaughtered hundreds of his own subjects who were believed to have contracted the dreaded plague of undeath. Arthas' downward spiral and ultimate surrender to the Lich King soon followed. The broken city is now inhabited by the undead Scourge -- led by the powerful lich, Kel'Thuzad. A contingent of Scarlet Crusaders, led by Grand Crusader Dathrohan, also holds a portion of the ravaged city. The two sides are locked in constant, violent combat. Those adventurers brave (or foolish) enough to enter Stratholme will be forced to contend with both factions before long. It is said that the city is guarded by three massive watchtowers, as well as powerful necromancers, banshees and abominations. There have also been reports of a malefic Death Knight riding atop an unholy steed, dispensing indiscriminate wrath on all those who venture within the realm of the Scourge.",lvl=48,mapID=317,maps={318},savedInstanceID=329,u=1608,["zone-text-areaID"]=2017,g={n(-1000004,{ach(646,{OnUpdate=handlers.ANY_SOURCE_QUEST,providers={{"n",10813}},sourceQuests={5263}})}),n(-1000031,{q(5263,{coords={{81.4,59.8,1423}},lvl=55,qgs={11039},rwp=40003,sourceQuests={5262},g={qo(1,{providers={{"i",13251}},rwp=40003})}}),q(5125,{cost={{"i",12845,1}},qgs={10917},rwp=40003,sourceQuests={5122},g={i(17044,{b=1,f=51,q=3,rwp=40003}),i(17045,{b=1,f=52,q=3,rwp=40003})}}),q(5861,{coords={{7.6,43.6,1423}},lvl=52,providers={{"i",14872}},qgs={1855},rwp=40003,sourceQuests={5848}}),q(5243,{coords={{81.6,57.8,1423}},cost={{"i",13180,5}},description="When mousing over the crates, look for 'Requires: Disarm Trap'. If you see this, it's a trap and shouldn't be touched.\n\nIf you are a dwarf, use find treasure and on the mini map it will show a dot for the holy water in the crate. It will only show crates with items in it on the mini map and not bad crates.",lvl=55,qgs={11036},rwp=40003,g={s(160898,13216,{b=1,f=4,q=2,rwp=40003}),i(13217,{b=1,f=52,q=2,rw