22,q=4,rwp=20001,u=1607}),s(218671,220602,{b=1,f=8,q=4,rwp=20001,u=1607}),s(218585,220511,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218677,220615,{b=1,f=3,q=3,rwp=20001,u=1607}),s(218598,220527,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218600,220529,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218607,220537,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218609,220539,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218624,220554,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218631,220561,{b=1,f=7,q=3,rwp=20001,u=1607}),i(220635,{b=1,q=4,rwp=20001,u=1607})}}),n(218819,{description="Kite the boss through the corridor.\n\nPlayers should focus on continuously moving between Gunk casts to avoid the poison pools. Gunk must be cleansed ASAP.\n\nThe boss will gain speed from Slime Time throughout the fight, to stop this: kill the Atal'ai Slab, Atal'ai Mask, Atal'ai Candle, and Atal'ai Drum objects which are located along the corridor. Ideally, have the melee focus on this to avoid getting Devoured themselves.",rwp=20001,u=1607,g={s(218639,220569,{b=1,f=24,q=4,rwp=20001,u=1607}),s(218640,220571,{b=1,f=32,q=4,rwp=20001,u=1607}),s(218592,220518,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218608,220538,{b=1,f=4,q=4,rwp=20001,u=1607}),s(218610,220540,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218611,220541,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218615,220545,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218616,220546,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218612,220542,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218620,220550,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218622,220552,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218635,220565,{b=1,f=4,q=3,rwp=20001,u=1607}),i(221484,{b=1,q=4,rwp=20001,u=1607}),i(221281,{q=3,rwp=20001,u=1607})}}),n(-1000185,{description="The Atal'ai Defenders are the third boss encounter in The Temple of Atal'Hakkar.\n\nGasher & Mijan's abilities are the most threatening.\n\nOnce killed, each boss will respawn as an undead. Do not attack them, instead use Shackle Undead and Freezing Trap to CC them.",rwp=20001,u=1607,g={n(221637,{description="|cffff0000Fervor|r can cause him to deal a lot of damage, focus him down fast; if needed, the tank can run away from Gasher while still in range of casters to minimize the damage taken if Gasher gets high stacks.\n\nSpinning Axes - Spawns spinning axes around him, this deals minor cleave damage.",rwp=20001,u=1607,g={s(218712,220674,{b=1,f=20,q=4,rwp=20001,u=1607}),s(218660,220591,{b=1,f=28,q=4,rwp=20001,u=1607}),s(218641,220572,{b=1,f=33,q=3,rwp=20001,u=1607}),s(218590,220516,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218595,220522,{b=1,f=4,q=3,rwp=20001,u=1607}),s(218676,220611,{b=1,f=3,q=3,rwp=20001,u=1607}),s(218599,220528,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218602,220532,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218603,220533,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218618,220548,{b=1,f=4,q=3,rwp=20001,u=1607}),s(218625,220555,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218628,220558,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218630,220560,{b=1,f=7,q=3,rwp=20001,u=1607}),i(220638,{b=1,q=4,rwp=20001,u=1607})}}),n(218922,{description="Curse of Blood - Dispellable curse which increases a player's damage taken. This can be interrupted.",rwp=20001,u=1607}),n(221638,{description="Demoralizing Shout - Interruptable AoE debuff which reduces player's attack power by 40.",rwp=20001,u=1607}),n(218868,{description="|cffff0000Mijan's Atal'ai Serpent Totems|r should be interrupted and killed asap in order to minimize damage taken. These can deal a fair bit of damage if they happen to focus the same player.\n\nRenew - Interruptable self heal ability, make sure to have someone focused on kicking this to increase kill time.\n\nThorns - Dispellable self thorns buff, should be removed to minimize melee players' damage taken.",rwp=20001,u=1607}),n(221639,{description="Chain lightning increases damage which each subsequent hit, this can be interrupted.",rwp=20001,u=1607}),n(221640,{description="Frailty - Reduces all attributes of nearby enemies by 10 for 1 min. Can be dispelled.",rwp=20001,u=1607})}}),n(220833,{description="The bosses cast Acid Breath, so you should two tank this fight. DPS Dreamscythe to 80% and Weaver to 60%. Avoid facing either boss into the raid.\n\nFor positioning, you really want to avoid getting knocked back into both the outside poison pool which surrounds the boss arena, as well as the middle pit which will cause you to die from fall damage by either of the wing buffet abilities. To avoid the pit you should either stand next to it so that you get knocked back parallel to it; or stand right against it to get knocked over to the opposite side of it. Doing either, depending on what's easier for you at that moment, will gain you uptime on casting.\n\nIdeally, have all of the damage dealers focusing a single boss as the bosses share health pools. This way you'll be focusing a fully debuffed target.",providers={{"n",220864}},rwp=20001,u=1607,g={s(218653,220584,{b=1,f=25,q=3,rwp=20001,u=1607}),s(218656,220587,{b=1,f=20,q=4,rwp=20001,u=1607}),s(218663,220594,{b=1,f=29,q=4,rwp=20001,u=1607}),s(218636,220566,{b=1,f=29,q=4,rwp=20001,u=1607}),s(218650,220581,{b=1,f=23,q=4,rwp=20001,u=1607}),s(218594,220521,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218593,220519,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218675,220609,{b=1,f=3,q=3,rwp=20001,u=1607}),s(218606,220536,{b=1,f=4,q=3,rwp=20001,u=1607}),s(218614,220544,{b=1,f=5,q=3,rwp=20001,u=1607}),s(218619,220549,{b=1,f=4,q=3,rwp=20001,u=1607}),s(218621,220551,{b=1,f=5,q=3,rwp=20001,u=1607}),i(221298,{q=3,rwp=20001,u=1607})}}),n(218721,{description="This fight has two different versions which rotate every week.\n\nOne where Ogom the Wretched dies first, making Jammal'an the Prophet the main boss.\n Mass Penance is a spoopy mechanic.\n\nThe other where Jammal'an the Prophet dies first, making Ogom the Wretched the main boss.\n Avoid Consecration.",providers={{"n",218718}},rwp=20001,u=1607,g={s(218645,220576,{b=1,f=21,q=3,rwp=20001,u=1607}),s(218644,220575,{b=1,f=21,q=3,rwp=20001,u=1607}),s(218647,220578,{b=1,f=23,q=4,rwp=20001,u=1607}),s(218655,220586,{b=1,f=20,q=4,rwp=20001,u=1607}),s(218652,220583,{b=1,f=25,q=3,rwp=20001,u=1607}),s(218670,220601,{b=1,f=8,q=4,rwp=20001,u=1607}),s(218589,220515,{b=1,f=6,q=3,rwp=20001,u=1607}),i(220624,{b=1,f=51,q=3,rwp=20001,u=1607}),i(220623,{b=1,f=51,q=4,rwp=20001,u=1607}),i(220625,{b=1,f=51,q=3,rwp=20001,u=1607}),s(218605,220535,{b=1,f=4,q=4,rwp=20001,u=1607}),s(218617,220547,{b=1,f=4,q=3,rwp=20001,u=1607}),s(218626,220556,{b=1,f=4,q=3,rwp=20001,u=1607}),i(220605,{b=1,q=3,rwp=20001,u=1607})}}),n(221943,{description="Keep the boss stationary to avoid the frontal Corrupted Breath and Backfire from the tail. Tanks swap every 2-3 stacks. Big heals for Dreamer's Lament ability!\n\nAt 80%, Hazzas will cast Animate Flame which will summon elementals. Stack & nuke them. They also drop fire on the floor. You can use the fire to avoid being sent downstairs to Morphaz during Lucid Dreaming.\n\nAt 30%, Hazzas will cast Lucid Dreaming again and then begin casting Eternal Slumber. You must bear the damage check and the cast will be canceled.\n\nDodge Falling Rocks.",providers={{"n",221942}},rwp=20001,u=1607,g={s(218665,220596,{b=1,f=28,q=4,rwp=20001,u=1607}),s(218923,220965,{b=1,f=22,q=4,rwp=20001,u=1607}),s(218658,220589,{b=1,f=34,q=4,rwp=20001,u=1607}),s(218668,220599,{b=1,f=1,q=4,rwp=20001,u=1607}),s(218666,220597,{b=1,f=1,q=4,rwp=20001,u=1607}),s(218667,220598,{b=1,f=1,q=4,rwp=20001,u=1607}),s(218586,220512,{b=1,f=7,q=3,rwp=20001,u=1607}),s(218588,220514,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218613,220543,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218623,220553,{b=1,f=6,q=4,rwp=20001,u=1607}),s(218629,220559,{b=1,f=6,q=3,rwp=20001,u=1607}),s(218633,220563,{b=1,f=6,q=3,rwp=20001,u=1607}),i(220606,{b=1,q=3,rwp=20001,u=1607}),i(220607,{b=1,q=3,rwp=20001,u=1607}),i(221298,{q=3,rwp=20001,u=1607})}}),n(218571,{description="The boss casts Corrosive Breath and has a tail sweep. Tanks should swap after each breath.\n\nDispell Lethargic Poison. Interupt Bellowing Roar!\n\nWhen the boss casts Deep Slumber, you'll want everyone to stack close to the boss so that when the boss casts Waking Nightmare, everyone can jump into the pool and to get afflicted and then move out asap to avoid getting CC'd again.\n\nAt 70%, the boss will summon two Lumbering Dreamwalkers. Kill them and interupt their Deep Slumber casts. Kill any whelplings that spawn.\n\nAt 40%, he'll repeat this and then summon two Nightmare Scalebanes. These cast Acid Rain that can be interupted, so the raid should spread out to avoid this.",rwp=20001,u=1607,g={i(221475,{b=1,q=2,rwp=20001,u=1607}),s(218654,220585,{b=1,f=20,q=4,rwp=20001,u=1607}),s(218651,220582,{b=1,f=25,q=4,rwp=20001,u=1607}),s(218642,220573,{b=1,f=32,q=4,rwp=20001,u=1607}),s(218664,220595,{b=1,f=28,q=4,rwp=20001,u=1607}),s(218643,220574,{b=1,f=21,q=4,rwp=20001,u=1607}),s(218648,220579,{b=1,f=23,q=4,rwp=20001,u=1607}),s(218669,220600,{b=1,f=8,q=4,rwp=20001,u=1607}),s(218673,220604,{b=1,f=27,q=4,rwp=20001,u=1607}),s(218672,220603,{b=1,f=27,q=4,rwp=20001,u=1607}),s(218596,220523,{b=1,f=4,q=4,rwp=20001,u=1607}),i(220622,{b=1,f=51,q=4,rwp=20001,u=1607}),s(218634,220564,{b=1,f=5,q=4,rwp=20001,u=1607}),i(221298,{q=3,rwp=20001,u=1607})}}),n(221394,{description="Have all the ranged stacked and then kill the four Atal'ai Ritualists.\n\nOnce Hakkari Bloodkeeper casts Bubbling Blood, move out of it. He'll ocasionally cast Spirit Chains, move out of the group before getting dispelled. (it will spread otherwise) Frightsome Howl should be dispelled immediately.\n\nAfter 33 seconds the Bloodkeeper will resurrect Hakkar and pass on some of the damage dealt to him during that time.\n\nDecurse Curse of Tongues, and dispel the Insanity mind control that'll happen once in a while.\n\nThe boss will occasionally cast Corrupted Blood, afflicted players should move out of the raid as fast as they can, and move to the front of the boss (away from the tank) to then get hit by Drain Blood. This will dispel the debuff. Move back afterwards and then kill the boss.",rwp=20001,u=1607,g={i(221346,{b=1,q=4,rwp=200