he ancestral home of the Bronzebeard dwarves. King Bronzebeard rules the kingdom of Khaz Modan from the throne room within the city. The Great Forge area gave the city its name.\n\nCarved into the stone heart of Khaz Modan, the mighty city of Ironforge is a testament to the dwarves' strength and resilience. The city is perhaps the most intricate of the Alliance cities, boasting many small passageways, shops built into the rock walls, and cavernous rooms. The feel of the city is a bustling, rowdy, and somewhat industrial one. However, it is predominantly safe-feeling and cozy; fires roar in the hearths of the inns and shops, and much dwarven laughing and frivolity is to be heard. Also, unlike Stormwind and Darnassus, the city is actually a massive cavern carved into the earth by the dwarves; the ceiling and floor are both hard stone.\n\nMainly because of the Deeprun Tram, linking Ironforge and Stormwind City, and the district of Tinker Town, Ironforge is one of the most racially diverse cities in the Alliance world. Dwarves predominate, of course, but you will find plenty of gnomes even outside of Tinker Town, and probably as many humans. You will find almost no night elves however, as they probably prefer more natural and open spaced environments.",g={n(-1000004),n(-1000020,{faction(54,{icon=236446,OnTooltip=_.OnTooltipDB.RuneclothTurnIns,r=2}),faction(47,{icon=236444,OnTooltip=_.OnTooltipDB.RuneclothTurnIns,r=2})}),n(-1000021,{fp(6,{coords={{55.6,48,1455}},crs={1573},r=2})}),n(-1000030,{prof(164,{n(4258,{coords={{52.6,40.8,1455}},r=2,g={r(2018,{learnedAt=0,lvl=5,rank=1,requireSkill=164}),r(3100,{learnedAt=50,lvl=10,rank=2,requireSkill=164,rwp=80001}),r(3538,{learnedAt=125,OnUpdate=function(t)t.lvl=settings:GetUnobtainableFilter(1605)and 26 or 20;end,rank=3,requireSkill=164,rwp=80001}),n(-1000060,{r(2661,{learnedAt=35,requireSkill=164}),r(3319,{learnedAt=20,requireSkill=164}),r(2663,{learnedAt=1,requireSkill=164}),r(2662,{learnedAt=1,requireSkill=164}),r(7223,{learn