stone for Lower Blackrock Spire, turn left and head up the hallway.\n4. Watch out for level 54-ish mobs and take the first right in to a small room.\n5. You will see two copies of the book laying on the floor.\n*One is next to a pair of mobs. Another is in a small nook where you may safely loot the book without pulling aggro.",f=55,providers={{"o",457099}},q=2,u=1608,g={r(459313,{c={1,2,4,7,9,11},u=1608})}})})}}),m(1419,{icon=236720,lore="The Blasted Lands bear that name for a reason: they were twisted by the magic that brought the Dark Portal into being, spewing the rampaging Horde into Azeroth.\n\nThis wasted desert of red clay is home to the original Dark Portal. The portal still stands, and leads to Outland — the remains of the orcs' sundered homeworld, Draenor. Nethergarde Keep, a Stormwind fortress of dour mages and paladins, keeps watch over the portal and the demons and ogres that would abuse its power.\n\nNow, the wretched land hosts few inhabitants and no significant settlements. Magic that leaked through the Dark Portal warped the Blasted Lands, leaving an infertile desert landscape. Hardy desert species like Basilisks, Scorpions and Hyenas have since colonized the area. The red rocks of the region do not come by their color naturally. The original tan color was transmuted into the unearthly crimson by searing heat and chaotic energies when the Dark Portal was destroyed.",g={n(-1000004,{ach(766,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate,g={crit(1029,{achID=766,id=1}),crit(1032,{achID=766,id=1}),crit(14165,{achID=766,id=1}),crit(14166,{achID=766,id=1}),crit(14167,{achID=766,id=1}),crit(14169,{achID=766,id=1}),crit(14168,{achID=766,id=1}),crit(1036,{achID=766,id=1}),crit(1033,{achID=766,id=1}),crit(1030,{achID=766,id=1}),crit(1028,{achID=766,id=1}),crit(1031,{achID=766,id=1}),crit(1034,{achID=766,id=1}),crit(1035,{achID=766,id=1}),crit(1280,{achID=42,id=1})}})}),n(-1000019,{exp(1441),exp(1437),exp(1439),exp(1457),exp(1438),