c stronghold in the Second War, stands proud and defiant among the mountains. Dark Iron dwarves control the fortress's deeps, though rumor has it that Ragnaros the Fire Lord still broods in the shadows. Black dragons under Nefarion hold the spire's upper levels, and the two groups battle constantly for supremacy. The surrounding countryside is home to Blackrock orcs and Fire-Gut ogres, all brutal castoffs from the Second War. The Molten Span, a massive stone edifice in the north, bridges a river of fire and leads to Khaz Modan.",g={n(-1000004,{ach(775,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate,g={crit(1138,{achID=775,id=1}),crit(1139,{achID=775,id=1}),crit(1141,{achID=775,id=1}),crit(1144,{achID=775,id=1}),crit(1145,{achID=775,id=1}),crit(1136,{achID=775,id=1}),crit(1137,{achID=775,id=1}),crit(1143,{achID=775,id=1}),crit(1140,{achID=775,id=1}),crit(1142,{achID=775,id=1}),crit(1281,{achID=42,id=1})}})}),n(-1000019,{exp(255),exp(254),exp(2417),exp(252),exp(2421),exp(249),exp(2418),exp(250),exp(2420),exp(253)}),n(-1000021,{fp(70,{coords={{65.6,24.2,1428}},crs={13177},r=1}),fp(71,{coords={{84.4,68.2,1428}},crs={2299},r=2})}),n(-1000031,{q(7630,{c={9},coords={{12.4,31.6,1428}},cost={{"i",12360,3}},lvl=60,qgs={14437},rwp=40003,sourceQuests={7626,7627,7628}}),q(7626,{c={9},coords={{12.6,31.6,1428}},cost={{"i",9264,10}},lvl=60,qgs={14436},rwp=40003,sourceQuests={7564}}),q(4726,{coords={{65.2,23.8,1428}},lvl=50,qgs={10267},rwp=40003,g={qo(1,{crs={7047,7048,7049},providers={{"i",12283},{"i",12284},{"o",175264}},rwp=40003})}}),q(7628,{c={9},coords={{12.6,31.6,1428}},cost={{"i",15416,35}},lvl=60,qgs={14436},rwp=40003,sourceQuests={7564}}),q(3823,{coords={{84.6,68.8,1428}},lvl=48,qgs={9177},r=2,rwp=40003,g={qo(1,{providers={{"n",7034}},rwp=40003}),qo(2,{providers={{"n",7033}},rwp=40003}),qo(3,{providers={{"n",7035}},rwp=40003})}}),q(4808,{coords={{65.2,23.8,1428}},lvl=50,providers={{"i",12438}},qgs={10267},rwp=40003,sourceQuests={4726}}),q(4283,