es dominate the Searing Gorge. A large population of Dark Iron dwarves, War Golems, and Elementals resides in this dark, mountainous area.\n\nThe climate is very similar to Burning Steppes, as it was the same catastrophe that blackened both: the summoning of Ragnaros. The Searing Gorge is a part of Khaz Modan. Before being shattered by the summoning it was a mountainous region, part of the Redridge Mountains.\n\nLarge mining operations take place in The Cauldron, a giant excavation site forming a huge rift in the middle of the Searing Gorge. The Slag Pit lies within The Cauldron and is an underground mining site rich with multiple types of ore. The mining work is mainly done by slave labor, which consists for the most part of captured enemies.\n\nEver since the Dark Iron dwarves' capital, Thaurissan, was destroyed by the summoning of Ragnaros, they have searched for a landmass to control for their filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage.",g={n(-1000004,{ach(774,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate,g={crit(1134,{achID=774,id=1}),crit(1130,{achID=774,id=1}),crit(1131,{achID=774,id=1}),crit(1132,{achID=774,id=1}),crit(1129,{achID=774,id=1}),crit(1135,{achID=774,id=1}),crit(15121,{achID=774,id=1}),crit(15120,{achID=774,id=1}),crit(1291,{achID=42,id=1})}})}),n(-1000997,{awp=11503,u=1608,g={n(-1000031,{u=1608,g={q(84360,{coords={{38.2,27,1427}},isDaily=1,lvl=53,maxReputation={59,42000},qgs={14625},u=1608,g={qo(1,{coords={{33,31,1427}},providers={{"n",228718}},u=1608}),i(227801,{b=1,q=2,u=1608})}}),q(84350,{coords={{38.2,27.8,1427}},isDaily=1,lvl=53,maxReputation={59,42000},qgs={14628},u=1608,g={qo(1,{providers={{"n",228723}},u=1608}),i(227801,{b=1,q=2,u=1608})}}),q(84372,{coords={{