warves who make their residence at Aerie Peak in the west. The Wildhammers have always been staunch allies of the Alliance. It is from the Hinterlands that these dwarves find and tame their world-renowned gryphons. The Razorbeak gryphons roam wild in this region.\n\nAlso in the Hinterlands is one of the last remaining settlements of the high elves in Lordaeron at the Quel'Danil Lodge.\n\nThe Hinterlands are also home to a large population of forest trolls, which are divided into three separate tribes. The Revantusk tribe is the only one of the three that has declared sides in the Horde/Alliance conflict and support the warchief Thrall of the Horde. The Vilebranch tribe holds residence in the massive troll city of Jintha'Alor as well as the Altar of Zul while the Witherbark tribe holds the smallest influence, hailing from the temples of Shadra'Alor.",g={n(-1000004,{ach(773,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate,g={crit(1117,{achID=773,id=1}),crit(1125,{achID=773,id=1}),crit(1128,{achID=773,id=1}),crit(1121,{achID=773,id=1}),crit(1119,{achID=773,id=1}),crit(1118,{achID=773,id=1}),crit(1124,{achID=773,id=1}),crit(1116,{achID=773,id=1}),crit(1126,{achID=773,id=1}),crit(1115,{achID=773,id=1}),crit(1122,{achID=773,id=1}),crit(1123,{achID=773,id=1}),crit(1127,{achID=773,id=1}),crit(1120,{achID=773,id=1}),crit(1295,{achID=42,id=1})}})}),n(-1000019,{exp(348),exp(1884),exp(1885),exp(354),exp(1882),exp(350),exp(356),exp(353),exp(1917),exp(351),exp(355),exp(1886),exp(307),exp(1883)}),n(-1000020,{faction(471,{description="This faction gets removed completely with the TBC prepatch, so grinding this to Exalted makes no sense.\n\nYou can grind to 11999/12000 by just killing trolls and then you can *technically* grind to Exalted by turning in Troll Necklaces at a rate of 2 Reputation per 5 necklaces, but rather than encourage you to totally waste your life on a Reputation that gets ultimately removed from the game after the season is over, I'll 