cy and technology against Stormwind, control much of the area. Bandits and gnolls raid those farms that remain, and Stormwind's resources are stretched too thin to protect the beleaguered populace. Westfall has the mild temperatures of Elwynn, but winds batter it both from the sea and from Duskwood. The bare farmlands add little to break the wind, which can cut through clothing on a blustery day.",g={n(-1000004,{ach(802,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate,g={crit(1252,{achID=802,id=1}),crit(14156,{achID=802,id=1}),crit(1256,{achID=802,id=1}),crit(1253,{achID=802,id=1}),crit(1248,{achID=802,id=1}),crit(1251,{achID=802,id=1}),crit(1261,{achID=802,id=1}),crit(1257,{achID=802,id=1}),crit(1249,{achID=802,id=1}),crit(1255,{achID=802,id=1}),crit(1260,{achID=802,id=1}),crit(1258,{achID=802,id=1}),crit(1250,{achID=802,id=1}),crit(1297,{achID=42,id=1})}})}),n(-1000019,{exp(219),exp(921),exp(109),exp(113),exp(111),exp(2,{collectible=false}),exp(20),exp(5289,{collectible=false}),exp(107),exp(108),exp(919),exp(920),exp(917),exp(922),exp(916),exp(918),exp(5290,{collectible=false}),exp(115)}),n(-1000021,{fp(4,{coords={{56.6,52.6,1436}},crs={523},r=2})}),sp(921,{c={4},g={i(209031,{b=1,c={4},coords={{48.6,48.6,1436}},crs={95,121,504,589,590},q=1,u=1605,g={i(209030,{b=1,c={4},q=1,u=1605}),i(209029,{b=1,c={4},q=1,u=1605})}}),i(208772,{b=1,c={4},coords={{51,47,1436},{51.6,55.6,1436}},crs={210549},f=55,q=2,rwp=20001,u=1605,g={r(424984,{rwp=20001,u=1605})}})}}),n(-1000031,{q(79008,{awp=11501,coords={{37.5,50.7,1436},{46.4,73.8,1413}},lvl=14,providers={{"o",415107},{"o",417072}},r=2,u=1606,g={i(2459,{f=55,q=1,u=1606}),i(3388,{f=55,lvl=15,q=1,u=1606})}}),q(6181,{coords={{56.9,47.2,1436}},lvl=10,providers={{"i",15998}},qgs={491},races={1},rwp=40003}),q(136,{lvl=10,providers={{"i",1357}},rwp=40003}),q(138,{coords={{25.9,47.77,1436}},lvl=10,providers={{"o",35},{"i",1358}},rwp=40003,sourceQuests={136}}),q(139,{coords={{40.5,47.82,1436}},lvl=10,providers